import { React, useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import { getOneCity } from '../services/city';

export default function CityDetail({ data }) {
  const [cityDetail, setCityDetail] = useState(null);
  const { id } = useParams();

  useEffect(() => {
    const fetchCityDetail = async () => {
      const city = await getOneCity(id);
      setCityDetail(city);
      console.log(city);
    }
    fetchCityDetail();
  }, [id]);


  return (
    <div>CityDetail</div>
  )
}
